Not too big nor too small, 
the room size is just right for all;
Convenience & proximity are a plus point,
with shopping around the numerous food joints; 
Overall its a one-stop close destination for tourists especially Singaporeans.

It was a pleasure meeting  Tourism Malaysia Singapore  last week. We are looking forward for great partnership. 

